</div><div><br></div><div>STOMACH: See above.</div><div><br></div><div>SMALL AND LARGE INTESTINES: Grossly normal in caliber.</div><div><br></div><div>VASCULAR STRUCTURES: See above. Aorta and inferior vena cava are normal in caliber. Mural calcifications are seen in the aorta and its branches.</div><div><br></div><div>LYMPH NODES: No enlarged abdominal lymph nodes identified.</div><div><br></div><div>OSSEOUS STRUCTURES: Marginal spurs are noted in the spine. No gross lytic or blastic changes.</div><div><br></div><div>OTHERS: No ascites noted. Atelectatic changes are seen in the included bilateral lower lungs.</div><div><br></div><div><br></div><div>Impression:&nbsp;&nbsp;</div><div>Epigastric masses, consider pancreatic neoplasms. Histopathologic correlation is suggested for further evaluation. </div><div>Bland vs tumor thrombus, splenic vein.</div><div>Tiny non-enhancing hepatic nodules, probably cysts.</div><div>Small-sized kidneys, probably age-related.</div><div>Atherosclerotic arteries.</div><div>Degenerative osseous changes.</div><div><br></div>","","2024-08-05 11:44:39","2024-08-05 11:44:39"),
