("209","107","1800029203","4","1.3.12.2.1107.5.1.4.39111.30000024072501430443700000037","1","4","<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\">CT STONOGRAM</p><br><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">FINDINGS:<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><br></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\"><span lang=\"X-NONE\" style=\"\">A large cyst is noted in the lower pole of the left kidney, measuring 8.2 x 7.9 x 8.0cm. The kidneys are normal in size measuring approximately 9.2 x 5.8 x 5.0 cm (CC x AP x T) on the right and 10.4 x 5.2 x 6.0 cm on the left. The pelvocalyceal systems and ureters are not dilated. No radiopaque calculi are identified along the course of the urinary tract.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\"><br></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\"><span lang=\"X-NONE\" style=\"\">The urinary bladder is fairly distended without intraluminal abnormal density or abnormal filling defects noted.&nbsp; The wall is not thickened. The prostate gland is enlarged, measuring 3.8 x 4.6 x 3.3 cm (approximate volume of 30 grams). Parenchymal concretions are noted. &nbsp;No discrete mass is noted.&nbsp; Phleboliths are noted.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\"><br></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\"><span lang=\"X-NONE\" style=\"\">The visualized liver is not enlarged without discrete mass or abnormal calcification. There is patchy hepatic steatosis.&nbsp; The intrahepatic and extrahepatic bile ducts<br><br><br>\nare not dilated.&nbsp; The gallbladder is contracted without intraluminal calcified calculus.&nbsp; The pancreas is normal in size without focal density change.&nbsp; The pancreatic duct is not dilated. The adrenal glands and spleen are grossly normal.<o:p></o:p></span></p><br><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\">There&nbsp;are multiple diverticles in the ascending, descending and sigmoid colon with no&nbsp;associated inflammatory changes Bowel gas pattern is non-obstructive. There is</p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; line-height: normal;\"><span lang=\"X-NONE\" style=\"\"><br><br>\nno abnormal wall thickening demonstrated.&nbsp;The rest of the gastrointestinal tract is unremarkable.&nbsp;&nbsp; <font face=\"Arial, sans-serif\"><o:p></o:p></font></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><br></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">A small fat-filled umbilical hernia is noted, measuring 1.6 cm. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><br></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">No enlarged lymph nodes are seen. No evidence of ascites is appreciated.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><br></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">Osseous structures exhibit degenerative changes.&nbsp;<br><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\"><br>\n<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><br></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">IMPRESSION:&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">RENAL CYST, LEFT</span></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">PROSTATOMEGALY WITH CONCRETIONS</span></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">COLONIC DIVERTICULOSES WITH NO SIGNS OF DIVERTICULITIS</span></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">SMALL FAT-FILLED UMBILICAL HERNIA</span></p><br>\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"X-NONE\" style=\"\">DEGENERATIVE OSSEOUS CHANGES&nbsp;</span><span style=\"font-family:&quot;Arial&quot;,sans-serif\"><o:p></o:p></span></p>","","","","5","2024-08-04 08:58:50","2024-08-05 16:00:59","","","","ABDOMEN","","","","1","CT","2024-07-29 00:00:00"),
